import React from 'react';
import ReactDOM from 'react-dom';


class fileUpload extends React.Component{
	constructor(props){
		this.state = {
			selectedFile: null,
		}
	}
	onChangeHandler=event=>{
		this.setState({
			selectedFile: event.target.files[0],
			loaded: 0,
		})
	}

}



export default fileUpload;
